import React from "react";
 import "./styles.scss";
import StarDrop from '../pages/StarDrop'



function CoverPage({ onShow, handleOnShow }) {
  const coverPageClass = !onShow ? "cover-page full-screen" : "cover-page";

  return (
    <div className={coverPageClass} style={{backgroundColor:"#FFFFFF"}}>
    
      <button onClick={handleOnShow}>
        {onShow ? "Hello" : "Exit"}
      </button>
      <StarDrop />
    </div>
  );
}

export default CoverPage;
